import {createStore,combineReducers,applyMiddleware} from 'redux';
import thunk from 'redux-thunk';
import {composeWithDevTools, composeWithReducers} from 'redux-devtools-extension';
import {createTaskBackLogReducer} from '../reducers/createBookReducer/createTaskBackLogReducer';

const middlewares =[thunk];

const reducer = combineReducers({
    taskLogcreated:createTaskBackLogReducer,
});


const store =createStore(reducer,composeWithDevTools(applyMiddleware(...middlewares)));
